class Solution(object):
    def minimumCost(self, N, connections):
        """
        :type N: int
        :type connections: List[List[int]]
        :rtype: int
        """
        if len(connections) < N - 1:
            return -1

        sets = [i for i in range(N)]
        res = 0
                
        def find(x):
            if x != sets[x]:
                sets[x] = find(sets[x])
                
            return sets[x]
        
        for u, v, w in sorted(connections, key=lambda n: n[2]):
            x, y = find(u - 1), find(v - 1)

            if x != y:
                N -= 1
                res += w
                sets[x] = y

                if N == 0:
                    break
        
        return res

